                <h2>Top Deals Pizza</h2>
                <p className='p1'>Charades,Trivial pursuit,Hopscotch<br></br>and More...</p>
                <p className='p2'>Discover Now</p>
            </div>
            <div className='second-banner1 banner2 col-lg-4 col-12'>
                <h2>Electronic Deals</h2>
                <p className='p1'>Laptop, Computer, Audio, Video Game<br></br>Downloads and More...</p>
                <p className='p2'>Discover Now</p>
            </div>
        </div>
